// I took code https://cdnjs.cloudflare.com/ajax/libs/jszip/3.1.5/jszip.min.js I converted it to base64 and put it with a value for base64JsZipContent
const base64JsZipContent = "";

async function downloadImagesOrBackgroundImagesOrBoth() {
    const userChoice = prompt("Choose the download type:\nEnter 1 for both images and background images, 2 for images (img src), 3 for background images");

    const zip = new JSZip();

    if (userChoice === '1') {
        await Promise.all([downloadImages(zip), downloadBackgroundImages(zip)]);
        await downloadZip(zip);
    } else if (userChoice === '2') {
        await downloadImages(zip);
        await downloadZip(zip);
    } else if (userChoice === '3') {
        await downloadBackgroundImages(zip);
        await downloadZip(zip);
    } else {
        console.error("Invalid choice. Aborting download.");
    }
}

async function downloadImages(zip) {
    const images = document.querySelectorAll('img');
    const errors = [];

    await Promise.all(Array.from(images).map(async (img) => {
        try {
            const response = await fetch(img.src);
            if (!response.ok) {
                throw new Error(`Failed to fetch image: ${img.src}`);
            }

            const blob = await response.blob();
            const webpBlob = await convertToWebP(blob);
            const fileName = 'image_' + Date.now() + '.webp';
            zip.file(fileName, webpBlob);
        } catch (error) {
            console.error(error.message);
            errors.push(error.message);
        }
    }));

    if (errors.length === images.length) {
        console.error("All images failed to download. Aborting.");
    }
}

async function downloadBackgroundImages(zip) {
    const elementsWithBackground = document.querySelectorAll('[style*="background-image"]');
    const errors = [];

    await Promise.all(Array.from(elementsWithBackground).map(async (element) => {
        const backgroundImageUrl = getBackgroundImageUrl(element.style.backgroundImage);
        if (backgroundImageUrl) {
            try {
                const response = await fetch(backgroundImageUrl);
                if (!response.ok) {
                    throw new Error(`Failed to fetch background image: ${backgroundImageUrl}`);
                }

                const blob = await response.blob();
                const webpBlob = await convertToWebP(blob);
                const fileName = 'background_image_' + Date.now() + '.webp';
                zip.file(fileName, webpBlob);
            } catch (error) {
                console.error(error.message);
                errors.push(error.message);
            }

            element.setAttribute('data-downloaded', 'true');
        }
    }));

    if (errors.length === elementsWithBackground.length) {
        console.error("All background images failed to download. Aborting.");
    }
}

async function convertToWebP(blob) {
    return new Promise((resolve) => {
        const image = new Image();
        image.onload = () => {
            const canvas = document.createElement('canvas');
            canvas.width = image.naturalWidth;
            canvas.height = image.naturalHeight;
            canvas.getContext('2d').drawImage(image, 0, 0);
            canvas.toBlob((webpBlob) => {
                resolve(webpBlob);
            }, 'image/webp');
        };
        image.src = URL.createObjectURL(blob);
    });
}

function downloadBlob(blob, fileName) {
    const a = document.createElement('a');
    a.href = URL.createObjectURL(blob);
    a.download = fileName;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
}

function getBackgroundImageUrl(backgroundImageProperty) {
    const matches = backgroundImageProperty.match(/url\(['"]?(.*?)['"]?\)/);
    return matches ? matches[1] : null;
}

async function downloadZip(zip) {
    const content = await zip.generateAsync({ type: 'blob' });

    const a = document.createElement('a');
    a.href = URL.createObjectURL(content);
    a.download = 'downloaded_images.zip';
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
}

// Add the script dynamically
const script = document.createElement('script');
script.src = "data:text/javascript;base64," + base64JsZipContent;
document.body.appendChild(script);

// Start the download process call download() function
script.onload = function () {
    // Start the download process once the script is loaded
    downloadImagesOrBackgroundImagesOrBoth();
};
